$( document ).ready(function() {
  $(document).on('click', '.chat_list > a > div', function(){
    $('.chat_list > a > div').removeClass('active_chat');
      var $this = $(this);
      if (!$this.hasClass('acactive_chattive')) {
          $this.addClass('active_chat');
      }
  });
});
